                <li><button className='black-button' src=''>Sort</button></li>
            </ul>
            <ul>
                <li onClick={()=>{navigate("/currentListing")}}><button  className='white-button' src=''>All Listings</button></li>
                <li  onClick={()=>{navigate("/newListing")}}><button className='white-button' src=''>List an Apartment</button></li>
            </ul>
        </nav>
        <div className='wrapper'>

            <div className='apart-title'>
                <div className='title-text'>Browse Current Listings</div>
            </div>
            <div className='listing-subtitle'>Description</div>
            <div className='home-gallery-wrap'>
                {/* for card */}
                {
                    pureArr.map(item => (
                        <div  onClick={()=>{navigate("/specificListing")}} className='listing-gallery-item'>
                            <div className='item-picture'>
                                hello
                            </div>
                            <div className='item-description'>
                                <h5>Apartment #{item}</h5>
                                {/* <div className='sub-description'>description...................................................</div> */}
                            </div>
                        </div> 
                    ))
                    // pureArr.map(item => (
                    //     <div className='home-gallery-item'>
